import numpy as np

def group_and_calculate_mean_margin(data, group_size=10):
    groups = [data[i:i+group_size] for i in range(0, len(data), group_size)]

    mean_margins = []
    for group in groups:
        margins = [abs(x[0] - x[1]) for x in group]
        mean_margin = np.mean(margins)
        mean_margins.append(mean_margin)

    return mean_margins

